C5A413\u0026_nc_sid=4efc9f","config_width":320,"config_height":320},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/101124292_329591901344614_8565373455923160742_n.jpg?stp=dst-jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=E2l-dmjyggoAX-8ZTmP\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8QEZTrOtUafm2bBIQx-LyjD8m9xF-uBrTrGUIm0rRCrQ\u0026oe=62C5A413\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/101124292_329591901344614_8565373455923160742_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=E2l-dmjyggoAX-8ZTmP\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_aeMrxzHvKCK8vQ4nS-Aj_abSc9x-53rI7HdrBaMvmrw\u0026oe=62C5A413\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"__typename":"GraphImage","id":"2515393452642679411","edge_media_to_caption":{"edges":[{"node":{"text":"\"Education is the passport to the future, for tomorrow belongs to those who prepare for it today\" - Malcolm X\n\nWhat about children who can't afford education?\nDo we leave them with no tomorrow or do we build their tomorrow by lending them a hand?\n\nThat's what TGI scholarship is for \"A bridge connecting today with tomorrow\".\n\nThere would be questions about TGI scholarship and we are here to answer them.\n\n\ud83d\udd39Please tell us your name and your position in the organisation.\n\nDr Toluwalase Awoyemi and I am one of the Co-founders.\n\n\ud83d\udd38 What is TGI about?\nI tend to describe TGI as an organisation charged with returning education to schools.We provide career counselling, mentorship and university admission services to secondary and tertiary institution students in Africa.\n\n\ud83d\udd39 What brought about the idea to Sponsor students?\n\nWe always knew that funds constitute a significant hurdle to schooling in Nigeria. This idea has been brewing in my mind for a long time. It started when I watched a YouTube documentary of secondary school students who went to school bare rooted in Ibadan because there parents could not afford to buy foot wares for them. Since then, I have had it in mind that once I start earning, I would help reduce this financial hurdle for as many students as possible.\n\n\ud83d\udd38What is the sponsorship based on? \n\nThe scholarship is perhaps the most structured secondary school scholarship in Nigeria. We do not just give students money, we also mentor them, teach them, instill leadership, good character and civil service in them. Ultimately, they are expected to give back to their community.\n\n\ud83d\udd39How do you plan in getting money to sponsor the students? \n\nWe have taken a crowd funding approach. Anyone can be a part of this movement no matter how small the money seems. Even hundred naira makes a huge difference to our scholars.\n\n\ud83d\udd38How far do you see this going?\n\nWe hope this becomes bigger and better as we get more funds. We will continue to push for this as long as possible. We might even do a hundred year anniversary in the future.\n\nYou have heard from him.\n\nTo find out more about the ganglion scholarship , click the link in our bio."}}]},"shortcode":"CLoeQSfHDpz","edge_media_to_comment":{"count":1},"taken_at_timestamp":1614078288,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/152488931_254566006230424_8465793108821510805_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=FszB1_ki1GYAX_t_u0I\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9bTa5V0vQaMTTpP0ut0U3QZyASXxXW7ft_gUA9OcqFCA\u0026oe=62C5C2AE\u0026_nc_sid=4efc9f","edge_liked_by":{"count":17},"edge_media_preview_like":{"count":17},"owner":{"id":"43714335405"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/152488931_254566006230424_8